import React,{Component} from 'react';
import {
  Container,
  Nav,
  Navbar
}from "react-bootstrap";
class App extends Component {
  render() {
    return(
      <Container>
        <Navbar bg="dark" variant="dark">
          <Navbar.Brand style={{colo:"white"}} href="/">Akses Sport</Navbar.Brand>
          <Nav>
            <Nav.Item href="/">Home</Nav.Item>
            <Nav.Item href="/">Berita</Nav.Item>
            <Nav.Item href="/">Live Scores</Nav.Item>
            <Nav.Item ></Nav.Item>
            <Nav.Item href="/">Transfer Pemain</Nav.Item>
            <Nav.Item href="/">Tim</Nav.Item>  
          </Nav>
        </Navbar>
      </Container>
    );
  }
}


export default App;
